If this Policy ends (lapses) because a premium due for it was not paid, You can reinstate the Base Policy so that it provides insurance again as if it had never lapsed. To reinstate the Base Policy, You must: 
- request such reinstatement within five years following the date this Policy lapsed;
- pay all premiums for the Base Policy which would have been due if the Base Policy had never lapsed, with 7% interest per year, compounded annually;


The Primary Insured must be alive on the date We approve a reinstatement in order for that reinstatement to take effect. You cannot reinstate any coverage under this Policy after this Policy terminates.


Any Riders, which have ended (lapsed) because a premium was not paid, may also be reinstated with the Base Policy. 
